import './App.css';

function PokeCard() {
  return (
    <div className="card">
    <img src ="http://assets.stickpng.com/images/580b57fcd9996e24bc43c325.png"alt ="pikachua"/>
    <p className ="cardBody">
    <span>Name:Pikachua</span> <br/>
    <span>Height:1'4"</span> <span>Weigth:13lbs</span><br/>
    <span>Type:Electric</span> <span>Ability:Static</span>
    </p>4
  </div>
  );
}

export default PokeCard;
